function normalizeChips(value) {
  if (!value) return [];
  if (Array.isArray(value)) return value.filter(Boolean);
  if (typeof value === "string") {
    return value
      .split(",")
      .map((item) => item.trim())
      .filter(Boolean);
  }
  return [];
}

export function WorkSection({ limit }) {
  const [projects, setprojects] = useState(null);

  useEffect(() => {
    async function fetchPosts() {
      const res = await fetch(apiUrl);
      const data = await res.json();
      const parsed = JSON.parse(data.projects);
      console.log(parsed);

      setprojects(parsed);
    }
    fetchPosts();
  }, []);

  if (!projects)
    return (
      <>
        {Array.from({ length: 2 }).map((_, index) => (
          <div
            key={`skeleton-${index}`}
            className="rounded-3xl border border-zinc-800/70 bg-zinc-950/70 p-6 shadow-2xl"
          >
            <div className="flex flex-col gap-6">
              <Skeleton className="h-[220px] w-full rounded-2xl dark:bg-zinc-900 sm:h-[260px]" />
              <Skeleton className="h-[24px] w-3/5 rounded dark:bg-zinc-900" />
              <Skeleton className="h-[150px] w-full rounded dark:bg-zinc-900 sm:h-[180px]" />
            </div>
          </div>
        ))}
      </>
    );
  const projectsToShow = limit ? projects.slice(0, limit) : projects;

  return (
    <>
      {projectsToShow.map((project, index) => {
        const projectData =
          typeof project === "string" ? JSON.parse(project) : project;
        const chips = normalizeChips(
          projectData.tags ||
            projectData.chips ||
            projectData.stack ||
            projectData.skills
        );
        const meta = [
          projectData.role,
          projectData.year,
          projectData.category,
        ].filter(Boolean);
        const imageSrc =
          projectData.case_study_image_link || "/portfolio_pic_1.png";
        const caseStudyLink = projectData.case_study_link || projectData.link || "#";

        return (
          <div
            key={index}
            className="group flex h-full flex-col gap-6 rounded-3xl border border-zinc-800/70 bg-zinc-950/80 p-6 text-zinc-100 shadow-2xl transition-transform duration-300 hover:-translate-y-1"
          >
            <div className="overflow-hidden rounded-2xl border border-zinc-800/70">
              <Image
                src={imageSrc}
                height={250}
                width={500}
                alt={`Case study for ${projectData.name}`}
                priority={index < 2}
                className="aspect-[4/3] w-full object-cover transition-transform duration-500 group-hover:scale-[1.02]"
                placeholder="blur"
                blurDataURL="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR4nGP8/5+hHgAHggJ/PiFh0wAAAABJRU5ErkJggg=="
              />
            </div>
            <div className="space-y-3">
              {meta.length > 0 && (
                <p className="text-xs uppercase tracking-[0.2em] text-zinc-500">
                  {meta.join(" · ")}
                </p>
              )}
              <h3 className="text-xl font-semibold text-orange-200">
                {projectData.name}
              </h3>
              {chips.length > 0 && (
                <div className="flex flex-wrap gap-2">
                  {chips.map((chip) => (
                    <span
                      key={`${projectData.name}-${chip}`}
                      className="rounded-full border border-orange-500/30 bg-orange-500/10 px-2.5 py-1 text-xs uppercase tracking-[0.15em] text-orange-200"
                    >
                      {chip}
                    </span>
                  ))}
                </div>
              )}
              <p className="text-sm leading-relaxed text-zinc-300">
                {projectData.description}
              </p>
              <TransitionLink
                passHref
                legacyBehavior
                href={caseStudyLink}
              >
                <a
                  target="_blank"
                  rel="noreferrer"
                  className="inline-flex items-center gap-2 text-sm text-orange-300 transition-colors hover:text-orange-200"
                >
                  <span>View case study</span>
                  <span aria-hidden="true">→</span>
                </a>
              </TransitionLink>
            </div>
          </div>
        );
      })}
    </>
  );
}

